import React from "react";
import SmallCard from "./SmallCard.jsx";
import TallCard from "./TallCard.jsx";
import "../style/style-sefer-display.css";
var sefer = "mexico";

function Sefer() {
  return (
    <div className="sefer-display-card">
      <TallCard />
      <SmallCard />
      <TallCard />
      <TallCard />
    </div>
  );
}

export default Sefer;
